一，文件操作接口：

    1，上传文件：
        ACL可设置为：'private' 或 'public-read' 或 'public-read-write'

        $resp = $cli->putObject([
            'ACL' => 'public-read',
            'Bucket' => 'test-bucket-xxx',
            'Key' => 'test-key-xxx',
            'Body' => 'file content as a string'
        ]);

    2，下载文件：

        $resp = $cli->getObject([
            'Bucket' => 'test-bucket-xxx',
            'Key' => 'test-key-xxx',
