                'Bucket' => 'test-bucket-xxx',
                'Key' => 'test-key-xxx',
            ]);

        6.2， 使用自定义的ACL：
            可指定的Permission包括：'FULL_CONTROL', 'WRITE', 'WRITE_ACP', 'READ', 'READ_ACP'

            $resp = $cli->putObjectAcl([
                'AccessControlPolicy' => [
                    'Grants' => [
                        [
                            'Grantee' => [
                                'ID' => 'user_foo',
                                'Type' => 'CanonicalUser',
                            ],
                            'Permission' => 'WRITE',
                        ],
                        [
                            'Grantee' => [
                                'ID' => 'your-user-name',
